import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import { BrowserRouter } from 'react-router-dom'
import App from './App';

const Main  = () => {
  return (
    <div>
      <BrowserRouter>
        <App />
      </BrowserRouter>
      </div>
  )
}

ReactDOM.render(<Main />, document.getElementById('root'));
